マックスワイパーは従来の金属製ワイパーブレードとは異なり、ゴム製フラット構造を採用。空力特性に優れたエアロフォルムにより、高速走行時の浮き上がりを抑え、拭き取り性能に優れています。<br><br>国際標準規格ISO取得製品。厳格な品質マネジメントシステムをクリアしたISO/TS16949：2002取得製品です。<br><br>●運転席側580mm、助手席側450mmの2本セットです。●Uフック仕様車用●アーム幅9mmまで対応 ※写真はイメージです｡実際の商品と長さや本数が異なります｡<br><br>対応車種：H13.1-H22.11三菱 ランサー(Uフック仕様車専用）<br><br>保安基準対応品<br><br>ボディパーツ | ワイパー<tr><td colspan="2">
